import { Divider, Typography } from 'antd';
import React from 'react';
import { Wrapper, Row } from './styles';
const { Text } = Typography;

const TableComponent = () => {
  return (
    <Wrapper>
      <Row>
        <Text>asdasd</Text>
        <Text>asdasd</Text>
      </Row>
      <Divider style={{ marginTop: '-50px' }} />
      <Row>
        <Text>asdasd</Text>
        <Text>asdasd</Text>
      </Row>{' '}
      <Divider style={{ marginTop: '-50px' }} />
      <Row>
        <Text>asdasd</Text>
        <Text>asdasd</Text>
      </Row>
    </Wrapper>
  );
};

export default TableComponent;
